import './Footer.css';
// import LogoIMA from './Logo/Main';
import ListFooter from './List/Main';
import SociAl from './Social/Main';
import Media from 'react-media';

// Return Footer Main 
export default function ReturnFooteR() {
 return (<Media
  queries={{
   small: '(max-width: 599px)',
   medium: '(min-width: 600px) and (max-width:1199px)',
   large: '(min-width: 1200px)',
  }}>
  {matches => (
   <>
    {matches.small && <SmAllScreen />}
    {matches.medium && <MediUMScreen />}
    {matches.large && <LaRgeScreen />}
   </>
  )}
 </Media>

 );
};


export const ScreenLarge = () => (
 <div className='wrp-footer-money'>
  <h2>Logo</h2>
  <ListFooter />
  <SociAl />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-footer-money'>
  <h2>Logo</h2>
  <ListFooter />
  <SociAl />
 </div>
);
